import Navbar from "./Components/Navigation/Navbar";
import Input from "./Components/Pages/Input";
import Home from "./Components/Pages/Home";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
<Router>
<Routes>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route path="/posts">
          <Home/>
        </Route>
</Routes>
</Router>
    <Navbar/>
    <Input/>
    </>

  );
}

export default App;
